--Execute on Microsoft SQL Server 2016 or later, with sysadmin priviledges
DECLARE
	@SchemaName AS nvarchar(128) = 'tdq' -- All objects will be created in this schema
	,@Prefix AS nvarchar(128) = ''; -- All objects will be prefixed with this in their name
 
 
SET NOCOUNT ON;
DECLARE @SQL AS nvarchar(4000);
SET @SQL = 'SELECT OBJECT_ID(''[' + @SchemaName + '].[' + @Prefix + 'Box]'')';
DECLARE @ObjectIDTable AS TABLE(ObjectID int);
INSERT INTO @ObjectIDTable
EXEC (@SQL);
IF (SELECT TOP 1 ObjectID FROM @ObjectIDTable) IS NOT NULL THROW 50000, 'Box table already exists. Did you already run bootstrap? You can execute the unpack procedure, or drop the Box table, or change schema or prefix', 1
IF OBJECT_ID('tempdb..#BoxTable') IS NOT NULL DROP TABLE #BoxTable
SELECT ObjectName,ObjectType,ObjectSequence,CAST('' AS xml).value('xs:base64Binary(sql:column("BinaryContent"))','varbinary(max)')BinaryContent,TextContent,DecimalContent,DateContent,BitContent INTO #BoxTable FROM (VALUES
(N'AgentCategoryName','CONF',0,NULL,N'TacticalDQ',NULL,CAST(NULL AS datetimeoffset),CAST(NULL AS bit))
,(N'AgentIntervalMinutes','CONF',0,NULL,NULL,10.00000,NULL,NULL)
,(N'HomePrefix','CONF',0,NULL,N'alpha_',NULL,NULL,NULL)
,(N'HomeSchema','CONF',0,NULL,N'tdq',NULL,NULL,NULL)
,(N'MailErrorAddress','CONF',0,NULL,N'dj@olsen.gen.nz',NULL,NULL,NULL)
,(N'MailErrorReporting','CONF',0,NULL,NULL,NULL,NULL,'1')
,(N'MailFromAddress','CONF',0,NULL,N'tdq@olsen.gen.nz',NULL,NULL,NULL)
,(N'MailFromName','CONF',0,NULL,N'Tactical DQ Notification',NULL,NULL,NULL)
,(N'MailProfileDescription','CONF',0,NULL,N'Tactical DQ Notifications',NULL,NULL,NULL)
,(N'MailProfileName','CONF',0,NULL,N'TacticalDQ_tdq_alpha_Mail',NULL,NULL,NULL)
,(N'MailServerAddress','CONF',0,NULL,N'olsen.gen.nz',NULL,NULL,NULL)
,(N'MailServerPort','CONF',0,NULL,NULL,25.00000,NULL,NULL)
,(N'MailServerSSL','CONF',0,NULL,NULL,NULL,NULL,'0')
,(N'MailServerType','CONF',0,NULL,N'SMTP',NULL,NULL,NULL)
,(N'MailTemplateMeasureError','CONF',0,NULL,N'An error occurred while taking a measurement.\n\nMeasureID: $PARAMETER1$\n\nMeasurementID: $PARAMETER2$\n\nError Message: $PARAMETER3$',NULL,NULL,NULL)
,(N'MaxParallelMeasurements','CONF',0,NULL,NULL,5.00000,NULL,NULL)
,(N'MeasureViewPattern','CONF',0,NULL,N'measure[_]%',NULL,NULL,NULL)
,(N'RefreshPolicyDefault','CONF',0,NULL,N'Continuous',NULL,NULL,NULL)
,(N'RefreshTimeOffsetDefault','CONF',0,NULL,NULL,NULL,'0001-01-01 00:30:00 +00:00',NULL)
,(N'ReportHistoryDays','CONF',0,NULL,NULL,28.00000,NULL,NULL)
,(N'WorkingTimezoneName','CONF',0,NULL,N'New Zealand Standard Time',NULL,NULL,NULL)
,(N'Box','TABL',0,'',NULL,NULL,NULL,NULL)
,(N'CaseHistory','TABL',1,'',NULL,NULL,NULL,NULL)
,(N'Cases','TABL',1,'',NULL,NULL,NULL,NULL)
,(N'Log','TABL',1,'',NULL,NULL,NULL,NULL)
,(N'Measurements','TABL',1,'',NULL,NULL,NULL,NULL)
,(N'AgentConfig','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'BootstrapScript','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'BoxBit','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'BoxDate','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'BoxDec','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'BoxText','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'CasesMergeStatement','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'CasesSummary','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'MailConfig','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'MailSend','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'Measures','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'MeasuresValidation','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'Pack','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'PackTableScripts','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'Refresh','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'RefreshFromQueue','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'RefreshStatement','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'ReportMeasurementsDaily','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'ReportMeasurementsDetail','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'ReportMeasureProperties','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'RoundDate','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'Schedule','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'ScheduleCurrent','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'SchedulerConfig','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'Unpack','CODE',200,'',NULL,NULL,NULL,NULL)
,(N'measure_CUST-MAST-BGRP','MESR',200,'',NULL,NULL,NULL,NULL)
,(N'measure_CUST-MAST-NAME','MESR',200,'',NULL,NULL,NULL,NULL)
,(N'measure_CUST-MAST-PAYD','MESR',200,'',NULL,NULL,NULL,NULL)
,(N'measure_CUST-MAST-PHNO','MESR',200,'',NULL,NULL,NULL,NULL)
,(N'measure_SALE-TRAN-DELV','MESR',200,'',NULL,NULL,NULL,NULL)
)Box(ObjectName,ObjectType,ObjectSequence,BinaryContent,TextContent,DecimalContent,DateContent,BitContent)
SET @SQL =REPLACE(REPLACE((SELECT CAST(DECOMPRESS(BinaryContent) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Box'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
EXEC (@SQL);
SET @SQL ='INSERT INTO ['+@SchemaName+'].['+@Prefix+'Box] SELECT ObjectName,ObjectType,ObjectSequence,BinaryContent,TextContent,DecimalContent,DateContent,BitContent FROM #BoxTable';
EXEC (@SQL);
SET @SQL =REPLACE(REPLACE((SELECT CAST(DECOMPRESS(BinaryContent) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Unpack'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
SET @SQL =REPLACE(REPLACE(@SQL,'[/$schema/$]','[$schema$]'),'[/$prefix/$','[$prefix$');
EXEC (@SQL);
SET @SQL ='EXEC ['+@SchemaName+'].['+@Prefix+'Unpack]'
EXEC (@SQL);
IF OBJECT_ID('tempdb..#BoxTable') IS NOT NULL DROP TABLE #BoxTable;
